import React from 'react'

const axios = require('axios')

function Users() {
    
    var getUser = () => {
        axios.get('http://localhost:5000/api/dummy')
        .then( function(response) {
            console.log(response)
            var arr = response.data
            console.log(arr)
        })
        .catch(function (error) {
            console.log(error);
          })
    }

    return <>
    <button onClick = {getUser}>Show all users</button>
    <div>{arr.map( ele => <h3>ele.Name</h3>)}</div>
    </>
}

export default Users
